import React from 'react';

const LoginPage = () => {

    const handleLogin = ( {history} ) => {
        history.push('/');

    }

    return (
        <React.StrictMode>
            <div className="container mt-5">
                <h1>Login</h1>
                <hr />

                <button className="btn btn-primary mt-2" onClick={handleLogin }>Login</button>
            </div>
        </React.StrictMode>

    );
};

export default LoginPage;
